import React, {Component} from 'react';
import {Modal, ModalHeader, ModalBody, ModalFooter, Table, Button} from 'reactstrap';
import axios from 'axios';
class App extends Component  {
  state = {
    contactos: []
  }
  componentWillMount(){
    axios.get('https://localhost:44386/api/Contactos').then((response)=>{
      this.setState({
            contactos: response.data
      })
    });
  }

  render(){
    let contactos = this.state.contactos.map((contacto)=>{
      return(
        <tr key={contacto.Id}>
          <td>{contacto.id}</td>
          <td>{contacto.Nombre}</td>
          <td> {contacto.Celular}</td>
          <td> {contacto.Sexo}</td>
          <td>
            <Button color="success" size="sm" className="mr-2">Edit</Button>
            <Button color="danger" size="sm">Delete</Button>
          </td>
        </tr>
      )
    });
    return (
      <div className="App container">
        <Button color="primary" onClick={this.toggleNewContactoModal.bind(this)}>Agregar Contacto</Button>
        <Modal isOpen={this.state.newContactoModal} toggle={this.toggleNewContactoModal.bind(this)}>
         <ModalHeader toggle={this.toggleNewContactoModal.bind(this)}>Modal title</ModalHeader>
         <ModalBody>
           Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.
         </ModalBody>
         <ModalFooter>
           <Button color="primary" onClick={this.toggleNewContactoModal.bind(this)}>Do Something</Button>{' '}
           <Button color="secondary" onClick={this.toggleNewContactoModal.bind(this)}>Cancel</Button>
         </ModalFooter>
        </Modal>
        <Table>
          <thead>
            <tr>
              <th>#</th>
              <th>Nombre</th>
              <th>Celular</th>
              <th>Sexo</th>
              <th>Acciones</th>
            </tr>
          </thead>
          <tbody>
            {contactos}
          </tbody>
        </Table>
      </div>
    );
  }
}

export default App;
